import React from "react";
import {
    View,
    RefreshControl,
} from "../../../../marslab-library-react-native/components/atoms";
import { RouteAreaList } from "../../../../marslab-library-react-native/components/organisms";
import styles from "./styles";

const AreaRouteGroupList = ({
    totalMissionTitle,
    periodTitle,
    seatLeftTitle,
    completeTitle,
    winnerTitle,
    periodEndTitle,
    prizeTitle,
    completeInTitle,
    data,
    routeTitle,
    onSingleRouteMapPress,
    readLoading,
}) => {
    return (
        <View>
            <RouteAreaList
                data={data}
                style={styles}
                totalMissionTitle={totalMissionTitle}
                periodTitle={periodTitle}
                seatLeftTitle={seatLeftTitle}
                completeTitle={completeTitle}
                winnerTitle={winnerTitle}
                periodEndTitle={periodEndTitle}
                prizeTitle={prizeTitle}
                completeInTitle={completeInTitle}
                routeTitle={routeTitle}
                onSingleRouteMapPress={onSingleRouteMapPress}
                readLoading={readLoading}
            /> 
        </View>
    );
}

export { AreaRouteGroupList };
